import logo from './logo.svg';
import './App.css';
import UsersPage from './pages/UserPage';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/users' element={<UsersPage/>}></Route>       
      </Routes>
    </Router>
  );
}

export default App;
